import React, {Fragment} from 'react';

function HeaderCartButton(){

    return (
        <button>
            <FontAwesomeIcon icon="fa-solid fa-cart-shopping-fast" />
            <span>Your Cart</span>
            <span>3</span>
        </button>
    );
}

export default HeaderCartButton;
